import React from 'react';

import './about.css';


export const About = ({ bio }) => {
    return (
        <div className="about-container">
            <p>{bio}</p>
            
        </div>
        
           
        
    )
}
export const Social = ({ about }) => {
    return (
        <div className="project-card">
            <p><b>Name:</b> {about.name}</p>
            <p><b>Link:</b> <a href={about.link}>{about.link}</a> </p>
        </div>
    )
}
